// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

// For Remix IDE, use these import paths:
// 为 Remix IDE 使用以下导入路径:
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

/**
 * @title SnipingBot
 * @dev Automated trading bot for sniping arbitrage opportunities on Uniswap
 * 用于在 Uniswap 上寻找套利机会的自动交易机器人
 * 
 * REMIX DEPLOYMENT INSTRUCTIONS | REMIX 部署说明:
 * 1. Open in Remix IDE (https://remix.ethereum.org)
 *    在 Remix IDE 中打开 (https://remix.ethereum.org)
 * 
 * 2. Compile with Solidity 0.8.0 or higher
 *    使用 Solidity 0.8.0 或更高版本编译
 * 
 * 3. Deploy with these parameters | 使用以下参数部署:
 *    - Uniswap V2 Router (Ethereum Mainnet): 0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D
 *    - Uniswap V2 Factory (Ethereum Mainnet): 0x5C69bEe701ef814a2B6a3EDD4B1652CB9cc5aA6f
 * 
 * 4. After deployment | 部署后:
 *    - Whitelist tokens using whitelistToken()
 *    - Fund contract with ETH for gas
 *    - Approve tokens for trading
 *    使用 whitelistToken() 将代币加入白名单
 *    为 gas 费用注入 ETH
 *    批准代币进行交易
 */

interface IUniswapV2Router02 {
    function swapExactTokensForTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external returns (uint[] memory amounts);

    function getAmountsOut(uint amountIn, address[] calldata path) 
        external view returns (uint[] memory amounts);
}

interface IUniswapV2Factory {
    function getPair(address tokenA, address tokenB) external view returns (address pair);
}

interface IUniswapV2Pair {
    function token0() external view returns (address);
    function token1() external view returns (address);
    function getReserves() external view returns (uint112 reserve0, uint112 reserve1, uint32 blockTimestampLast);
}

contract SnipingBot is Ownable, ReentrancyGuard {
    // Constants | 常量
    uint256 private constant DEADLINE_EXTENSION = 300; // 5 minutes | 5分钟
    uint256 private constant MIN_PROFIT_THRESHOLD = 0.01 ether; // Minimum profit | 最小利润

    // State variables | 状态变量
    IUniswapV2Router02 public immutable uniswapRouter;
    IUniswapV2Factory public immutable uniswapFactory;
    mapping(address => bool) public whitelistedTokens;

    // Events | 事件
    event ProfitableOpportunity(
        address indexed token0,
        address indexed token1,
        uint256 profit,
        uint256 timestamp
    );

    event TradeExecuted(
        address indexed token0,
        address indexed token1,
        uint256 amountIn,
        uint256 amountOut,
        uint256 timestamp
    );

    /**
     * @dev Constructor
     * @param _uniswapRouter Uniswap V2 Router address | Uniswap V2 路由器地址
     * @param _uniswapFactory Uniswap V2 Factory address | Uniswap V2 工厂地址
     */
    constructor(
        address _uniswapRouter,
        address _uniswapFactory
    ) {
        require(_uniswapRouter != address(0), "Invalid router address");
        require(_uniswapFactory != address(0), "Invalid factory address");
        uniswapRouter = IUniswapV2Router02(_uniswapRouter);
        uniswapFactory = IUniswapV2Factory(_uniswapFactory);
        _transferOwnership(msg.sender);
    }

    /**
     * @dev Check price difference between exchanges
     * 检查交易所之间的价格差异
     */
    function checkPriceArbitrage(
        address tokenA,
        address tokenB,
        uint256 amountIn
    ) public view returns (uint256 potentialProfit) {
        require(whitelistedTokens[tokenA] && whitelistedTokens[tokenB], "Tokens not whitelisted");

        address[] memory path = new address[](2);
        path[0] = tokenA;
        path[1] = tokenB;

        uint256[] memory amountsOut = uniswapRouter.getAmountsOut(amountIn, path);

        if (amountsOut[1] > amountIn) {
            potentialProfit = amountsOut[1] - amountIn;
        }
    }

    /**
     * @dev Execute the snipe if profitable opportunity exists
     * 如果存在盈利机会则执行套利
     */
    function executeSnipe(
        address tokenA,
        address tokenB,
        uint256 amountIn
    ) external onlyOwner nonReentrant {
        require(whitelistedTokens[tokenA] && whitelistedTokens[tokenB], "Tokens not whitelisted");

        uint256 potentialProfit = checkPriceArbitrage(tokenA, tokenB, amountIn);
        require(potentialProfit >= MIN_PROFIT_THRESHOLD, "Insufficient profit margin");

        IERC20(tokenA).transferFrom(msg.sender, address(this), amountIn);
        IERC20(tokenA).approve(address(uniswapRouter), amountIn);

        address[] memory path = new address[](2);
        path[0] = tokenA;
        path[1] = tokenB;

        uint256[] memory amounts = uniswapRouter.swapExactTokensForTokens(
            amountIn,
            0, // Accept any amount of tokenB
            path,
            address(this),
            block.timestamp + DEADLINE_EXTENSION
        );

        emit TradeExecuted(
            tokenA,
            tokenB,
            amountIn,
            amounts[1],
            block.timestamp
        );
    }

    /**
     * @dev Add or remove tokens from whitelist
     * 添加或删除白名单代币
     */
    function whitelistToken(address token, bool status) external onlyOwner {
        require(token != address(0), "Invalid token address");
        whitelistedTokens[token] = status;
    }

    /**
     * @dev Withdraw tokens from the contract
     * 从合约中提取代币
     */
    function withdrawToken(address token, uint256 amount) external onlyOwner {
        require(token != address(0), "Invalid token address");
        require(amount > 0, "Amount must be greater than 0");

        IERC20(token).transfer(owner(), amount);
    }

    /**
     * @dev Withdraw ETH from the contract
     * 从合约中提取 ETH
     */
    function withdrawETH() external onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "No ETH to withdraw");

        (bool success, ) = owner().call{value: balance}("");
        require(success, "ETH transfer failed");
    }

    // Function to receive ETH | 接收 ETH 的函数
    receive() external payable {}

    // Fallback function | 回退函数
    fallback() external payable {}
}

contracts/SnipingBotTest.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./SnipingBot.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/**
 * @title SnipingBotTest
 * @dev Test contract for SnipingBot
 * 用于测试 SnipingBot 的测试合约
 */
contract SnipingBotTest {
    // Main contract instance | 主合约实例
    SnipingBot public snipingBot;

    // Test tokens | 测试代币
    address public testTokenA;
    address public testTokenB;

    // Events for testing | 测试事件
    event TestStarted(string testName);
    event TestCompleted(string testName, bool success);

    /**
     * @dev Constructor to deploy test environment
     * 构造函数，部署测试环境
     * @param _uniswapRouter Uniswap V2 Router address | Uniswap V2 路由器地址
     * @param _uniswapFactory Uniswap V2 Factory address | Uniswap V2 工厂地址
     */
    constructor(address _uniswapRouter, address _uniswapFactory) {
        // Deploy main contract | 部署主合约
        snipingBot = new SnipingBot(
            _uniswapRouter,
            _uniswapFactory
        );
    }

    /**
     * @dev Test Case 1: Setup whitelist
     * 测试用例1：设置白名单
     * @param tokenA First test token | 第一个测试代币
     * @param tokenB Second test token | 第二个测试代币
     */
    function testWhitelisting(address tokenA, address tokenB) public {
        emit TestStarted("Whitelisting Test");

        // Add tokens to whitelist | 将代币添加到白名单
        snipingBot.whitelistToken(tokenA, true);
        snipingBot.whitelistToken(tokenB, true);

        // Verify whitelisting | 验证白名单
        require(snipingBot.whitelistedTokens(tokenA), "TokenA not whitelisted");
        require(snipingBot.whitelistedTokens(tokenB), "TokenB not whitelisted");

        testTokenA = tokenA;
        testTokenB = tokenB;

        emit TestCompleted("Whitelisting Test", true);
    }

    /**
     * @dev Test Case 2: Check arbitrage calculation
     * 测试用例2：检查套利计算
     * @param amountIn Amount of input tokens | 输入代币数量
     */
    function testArbitrageCalculation(uint256 amountIn) public {
        emit TestStarted("Arbitrage Calculation Test");

        // Calculate potential profit | 计算潜在利润
        uint256 profit = snipingBot.checkPriceArbitrage(testTokenA, testTokenB, amountIn);

        // Log results | 记录结果
        emit TestCompleted("Arbitrage Calculation Test", true);
    }

    /**
     * @dev Test Case 3: Execute snipe with minimum amount
     * 测试用例3：使用最小金额执行套利
     * @param amountIn Amount of input tokens | 输入代币数量
     */
    function testMinimumSnipe(uint256 amountIn) public {
        emit TestStarted("Minimum Snipe Test");

        // Approve tokens | 授权代币
        IERC20(testTokenA).approve(address(snipingBot), amountIn);

        // Execute snipe | 执行套利
        try snipingBot.executeSnipe(testTokenA, testTokenB, amountIn) {
            emit TestCompleted("Minimum Snipe Test", true);
        } catch Error(string memory reason) {
            // Log failure reason | 记录失败原因
            emit TestCompleted("Minimum Snipe Test", false);
        }
    }

    /**
     * @dev Test Case 4: Test withdrawal functions
     * 测试用例4：测试提现功能
     */
    function testWithdrawals() public {
        emit TestStarted("Withdrawals Test");

        // Test ETH withdrawal | 测试 ETH 提现
        try snipingBot.withdrawETH() {
            emit TestCompleted("ETH Withdrawal Test", true);
        } catch {
            emit TestCompleted("ETH Withdrawal Test", false);
        }

        // Test token withdrawal | 测试代币提现
        try snipingBot.withdrawToken(testTokenA, 1000) {
            emit TestCompleted("Token Withdrawal Test", true);
        } catch {
            emit TestCompleted("Token Withdrawal Test", false);
        }
    }
}

